import React, { Component } from 'react'
import Table from '../../components/Table'

class List extends Component {

  constructor(props) {
    super(props)
    this.state = {
      data: [
        {id:1,name:'list chapters 1'},
        {id:2,name:'list chapters 2'},
      ],
      tableId: '#example1'
    }
  }

  render() {
    return (
      <div className="content-wrapper">
        <ContentHeader title='List Chapters' />
        <div className="content">
          <div className="row">
            <div className="col-md-12">
              <div className="card">
                <div className="card-header">
                  <h3 className="card-title">List Chapters</h3>
                  <ButtonAction title='Add chapters' icon='fas fa-plus' class='btn btn-primary float-right' url='/add-chapter' />
                </div>
                <Table data={data} />
              </div>
            </div>
          </div>
        </div>
      </div>
    )
  }
}

export default List
